import firebase from '../utils/firebase';
import 'firebase/firestore';

const firestore = firebase.firestore();

export default function Push(hash) {
    console.log(hash);

    const dataRef = firestore.collection('creditCard').doc()
    try{ 
      dataRef.set({
        hash});
    } catch {
      console.log("you idiot")
    }

}
